import Container from '@mui/material/Container';
import { useParams } from 'react-router-dom';
import React from 'react';



function Inicio() {
    const { param1, param2 } = useParams();

    return(

           <Container maxWidth="md">
                <h2>Inicio</h2>
                <p>Param1: {param1}</p>
                <p>Param2: {param2}</p>
            </Container>

    )
}
export default Inicio;
